(141, 7, 0, 1, 'SSC Recruitment 2016 – Apply Online for 4669 Constable (Executive) Posts ', 'Total No. of Posts: 4669\r\nName of the Post: Temporary Constables (Executive) – Male and Female in Delhi Police – 2016\r\n1. Constables (Executive) Male: 3115 Posts\r\na. Unreserved: 1557 Posts\r\nb. OBC: 847 Posts\r\nc. SC: 473 Posts\r\nd. ST: 238 Posts\r\n2. Constables (Executive) Female: 1554 Posts\r\na. Unreserved: 815 Posts\r\nb. OBC: 443 Posts\r\nc. SC: 250 Posts\r\nd. ST: 46 Posts\r\n\r\nAge Limit: Candidates age limit should be between 18 – 21 years for Constable (Exe) Male and 18 – 25 years for Constable (Exe) Female as on 01-07-2016. Relaxation of age will be applicable up to 05 years for SC/ ST candidates and 03 years for OBC candidates & other relaxation details refer the notification.\r\n\r\nEducational Qualification: Candidates should have 10+2 (Senior Secondary) pass from a recognized Board/ University.\r\n\r\nSelection Process: Candidates will be selected based on Physical Endurance and Measurement Test (PE&MT), Computer Based Written Examination, Detailed Medical Examination (DME) and Police Verification.\r\n\r\nApplication Fee: Candidates should pay Rs. 100/- through online by using SBI Challan/ Net banking/ Credit and Debit Cards. Women candidates and candidates belonging to SC, ST and Ex Servicemen eligible for reservation are exempted from paying fee.\r\n\r\nHow to Apply: Eligible candidates may apply online through the website www.ssconline.nic.in from 10-09-2016 to 10-10-2016 (21-10-2016) by 05:00 PM.\r\nImportant Dates:\r\n\r\nStarting Date to Apply Online	10-09-2016\r\nLast Date to Apply Online	10-10-2016 (21-10-2016) by 05:00 p.m.\r\nLast Date for Offline Challan Generation	10-10-2016 by 05:00 p.m.\r\nLast Date for Payment of Fee	13-10-2016\r\nDate of Computer Based Written Exam	04-03-2017\r\n\r\n\r\n', '2016-10-20', '2016-10-30', 0, 0, 0, 0),
