(168, 7, 0, 1, 'Syndicate Bank -400 Probationary Officer ', 'Total No. of Posts: 400\r\nName of the Post: Probationary Officer in Junior Management Grade/ Scale-I\r\n1. Unreserved: 202 Posts\r\n2. OBC: 108 Posts\r\n3. SC: 60 Posts\r\n4. ST: 30 Posts\r\n\r\nAge Limit: Candidates age limit should be between 20 to 28 years as on 01-10-2016 (i.e. a candidate must have been born not earlier than 02-10-1988 and not later than 01-10-1996 and (both days inclusive)). Age relaxation is applicable to 05 years for SC/ ST, 03 years for OBC (Non-Creamy Layer) candidates & 10 years for PWD candidates and other relaxation details refer the notification.\r\n\r\nEducational Qualification: Candidates should possess Degree (Graduation) with minimum 60% (55% for SC/ ST/ PWD) marks in any discipline from a recognized University or any equivalent qualification as such recognized by Central Government.\r\n\r\nSelection Process: Candidates will be selected based on online test followed by Group Discussion or/ and Personal Interview.\r\n\r\nApplication Fee: Candidates should pay Rs. 600/- (Application Fee + Intimation Charges) for General & Other candidates and Rs. 100/- (Intimation Charges Only) for SC/ ST/ PWD candidates through online by using only Master/ Visa Debit or Credit cards or Internet Banking.\r\n\r\nHow to Apply: Eligible candidates may apply online through the website www.syndicatebank.in from 14-12-2016 to 28-12-2016.\r\n\r\nInstructions to Apply Online:\r\n1. Before applying online candidates should have valid e mail id & contact number\r\n2. Candidates should scan their photograph & Signature\r\n3. Candidates log on the website www.syndicatebank.in\r\n4. Click on Annoucement ————-> Careers\r\n5. Select the desired post & clik on Apply Online\r\n6. Read all instructions & fill all the details\r\n7. Check once before submit the form\r\n8. Now take a print out of online application for future use\r\n\r\nImportant Dates:\r\n\r\nStarting Date to Apply Online and Payment of Fee	14-12-2016\r\nLast Date to Apply Online and Payment of Fee	28-12-2016\r\nLast Date for Editing Application Details	28-12-2016\r\nLast date for printing your application	12-01-2017\r\nDate for Download of Call letter for Examination	After 14-02-2017\r\nDate of Online Test (Tentative)	26-02-2017\r\n\r\n\r\n', '2016-12-29', '2017-01-08', 0, 0, 0, 0),
(169, 7, 0, 1, 'ICICI Recruitment  -Probationary Officer Posts', 'ICICI PO Vacancy Details:\r\nName of the Post: Probationary Officer\r\n\r\nAge Limit: Candidates age limit should be up to 25 years as on 31-12-2016 (i.e candidates should have been born on or after 31-12-1991).\r\n\r\nEducational Qualification: Candidates should possess Graduation with 55% (Aggregate) marks in any discipline.\r\n\r\nSelection Process:Candidates will be selected based on Online Aptitude Test, Online Psychometric Questionnaire, Case Based Group Discussion, Personal Interview & Merit List.\r\n\r\nHow to Apply: Eligible candidates may apply online through the website www.icicicareers.com for May 2017 and August 2017 batches will remain open till 31-12-2016.\r\n\r\nInstructions to Apply Online:\r\n1. Log on to the website www.icicicareers.com\r\n2. Click on Probationary Officer Programme\r\n3. Again Click on careers—–>”Apply”\r\n4. Select the desired Post click on “Probationary Officer Program”\r\n5. Read all instructions carefully & Click on “Apply Here”\r\n6. Fill all the mandatory details & submit the form.\r\n7. Take print out of application form for future use.\r\n\r\nStarting Date to Apply Online for May 2017 and August 2017 Batches: 31-12-2016\r\n\r\n\r\n\r\n', '2016-12-29', '2017-01-08', 0, 0, 0, 0),
(170, 7, 0, 1, 'SBI BANK- 2313 PO Posts', 'SBI Vacancy Details: \r\nTotal No. of Posts: 2313\r\nName of the Post: Probationary Officer\r\n1. SC: 347 Posts\r\n2. ST: 350 Posts\r\n3. OBC: 606 Posts\r\n4. GEN: 1010 Posts\r\n\r\nAge Limit: Candidates age should be 21 – 30 years (must have been born not earlier than 02-04-1987 and not later than 01-04-1996) as on 01-04-2017. Upper age relaxation is applicable by 3 years for OBC, 10 years for PWD, 5 years for SC/ ST/ Ex-Servicemen & Others candidates as per rules.\r\n\r\nEducational Qualification: Candidates should possess Graduation in any discipline from a recognised University or any equivalent qualification recognised as such by the Central Government.\r\n\r\nSelection Process: Selection will be based on Preliminary Examination, Main Examination, Group Exercises, Interview.\r\n\r\nApplication Fee: Candidates should pay Rs.600/- for General and Others, Rs. 100/- for SC/ ST/ PWD candidates through online by using Internet Banking, Debit Cards (RuPay/ Visa/ Master Card/ Maestro), Credit Cards, IMPS, Cash Cards/ Mobile Wallets.\r\n\r\nImportant Dates:\r\n\r\nStart Date for Online Registration Including Edit/Modification of Applications	07-02-2017\r\nLast Date for Online Registration Including Edit/Modification of Applications	06-03-2017\r\nDate for Payment of Application Fees/ Intimation Charges	07-02-2017 to 06-03-2017\r\nDate for Download of Call Letters for Online Preliminary Examination	15-04-2017 onwards\r\nDate for Online Examination – Preliminary	29th & 30th Apr and 6th & 7th May’17\r\nDate for Result of Online Exam – Preliminary	17-05-2017\r\nDate for Download of Call Letter for Online Main Exam	22-05-2017 onwards\r\nDate for Conduct of Online Examination – Main	04-06-2017\r\nDate for Declaration of Result – Main	19-06-2017\r\nDate for Download Call Letter for Interview	26-06-2017\r\nDate for Conduct of Group Exercises & Interview	10-07-2017 onwards\r\nDate for Declaration of Final Result	 05-08-2017\r\nPre-Examination Training for SC/ST/Religious Minority Community Candidates\r\nDate of Download of Call Letters for Pre-Exam Training	07-04-2017 onwards\r\nDate of Conduct of Pre-Exam Training	17-04-2017 to 22-04-2017\r\n\r\n\r\n', '2017-02-11', '2017-02-21', 0, 0, 0, 0),
(171, 7, 0, 1, 'IDBI Bank-111 Manager, AGM & DGM', 'IDBI Bank Vacancy Details:\r\nTotal No. of Posts: 111\r\nName of the Posts:\r\n1. Deputy General Manager (Grade D): 13 Posts\r\n2. Assistant General Manager (Grade C): 17 Posts\r\n3. Manager (Grade B): 81 Posts\r\n\r\nAge Limit: Candidates age limit should be 35 – 40/ 45 years for Post 1, 30 – 36 years for Post 2, 28 – 32 years for Post 3 as on 01-10-2016. Age relaxation is applicable to SC/ ST/ OBC/ Person with disabilities (PWD)/ Ex-Servicemen as per rules.\r\n\r\nEducational Qualification: Candidates should possess Graduation with first class in any stream from a recognized University/ Graduation in B.Sc Agri or Veterinary Science or in any allied courses in Agri from a recognized University or Graduation in any discipline from a recognized University with Post Graduate qualification as M. Tech. Agri or MBA Agri or M.Sc in relevant discipline. For more details refer the notification.\r\n\r\nSelection Process: Candidates will be selected based on group discussion & personnel interview for Post 1, online written test, personnel interview for post 2, 3.\r\n\r\nApplication Fee: Candidates should pay Rs. 150/- (Intimation Charges) for SC/ ST/ PWD candidates and Rs. 700/- (Application fee + Intimation Charges) for all other candidates through online by using Debit Cards (RuPay/ Visa/ MasterCard/ Maestro), Credit Cards, Internet Banking, IMPS, Cash Cards/ Mobile Wallets.\r\n\r\nHow to Apply: Eligible candidates may apply online through the website www.idbi.com from 01-02-2017 to 20-02-2017.\r\nImportant Dates:\r\nStarting Date to Apply Online & Payment of Fee: 01-02-2017.\r\nLast Date to Apply Online, Editing Applications & Payment of Fee: 20-02-2017.\r\nLast Date for Printing Applications: 07-03-2017.\r\nDate of Pre- Examination Training for SC/ ST/ OBC candidates: 14-03-2017 to 19-03-2017.\r\nDate of Online Test at all centers: 24-03-2017.\r\n\r\n', '2017-02-11', '2017-02-21', 0, 0, 0, 0),
(172, 7, 0, 1, 'IDBI Bank-111 Manager, AGM & DGM', 'IDBI Bank Vacancy Details:\r\nTotal No. of Posts: 111\r\nName of the Posts:\r\n1. Deputy General Manager (Grade D): 13 Posts\r\n2. Assistant General Manager (Grade C): 17 Posts\r\n3. Manager (Grade B): 81 Posts\r\n\r\nAge Limit: Candidates age limit should be 35 – 40/ 45 years for Post 1, 30 – 36 years for Post 2, 28 – 32 years for Post 3 as on 01-10-2016. Age relaxation is applicable to SC/ ST/ OBC/ Person with disabilities (PWD)/ Ex-Servicemen as per rules.\r\n\r\nEducational Qualification: Candidates should possess Graduation with first class in any stream from a recognized University/ Graduation in B.Sc Agri or Veterinary Science or in any allied courses in Agri from a recognized University or Graduation in any discipline from a recognized University with Post Graduate qualification as M. Tech. Agri or MBA Agri or M.Sc in relevant discipline. For more details refer the notification.\r\n\r\nSelection Process: Candidates will be selected based on group discussion & personnel interview for Post 1, online written test, personnel interview for post 2, 3.\r\n\r\nApplication Fee: Candidates should pay Rs. 150/- (Intimation Charges) for SC/ ST/ PWD candidates and Rs. 700/- (Application fee + Intimation Charges) for all other candidates through online by using Debit Cards (RuPay/ Visa/ MasterCard/ Maestro), Credit Cards, Internet Banking, IMPS, Cash Cards/ Mobile Wallets.\r\n\r\nHow to Apply: Eligible candidates may apply online through the website www.idbi.com from 01-02-2017 to 20-02-2017.\r\nImportant Dates:\r\nStarting Date to Apply Online & Payment of Fee: 01-02-2017.\r\nLast Date to Apply Online, Editing Applications & Payment of Fee: 20-02-2017.\r\nLast Date for Printing Applications: 07-03-2017.\r\nDate of Pre- Examination Training for SC/ ST/ OBC candidates: 14-03-2017 to 19-03-2017.\r\nDate of Online Test at all centers: 24-03-2017.\r\n\r\n', '2017-02-11', '2017-02-21', 0, 0, 0, 0),
