(174, 7, 0, 1, 'UPSC IES/ ISS Exam 2017 – Apply Online for 44 Posts ', 'UPSC IES/ ISS Vacancy Details:\r\nTotal No. of Posts: 44\r\nName of the Posts:\r\n1. Indian Economic Service: 15 Posts\r\n2. Indian Statistical Service: 29 Posts\r\n\r\nAge Limit: Candidates age should be between 21-30 years as on 01-08-2017 (He/ she must have been born not earlier than 02-08-1987 and not later than 01-08-1996). Age relaxation is applicable 5 years for SC/ ST, 3 years for OBC & for others as per rules.\r\n\r\nEducational Qualification: Candidates should possess Post-Graduate Degree in Economics/ Applied Economics/ Business Economics/ Econometrics for Post 1, Bachelor’s Degree with Statistics/ Mathematical Statistics/ Applied Statistics as one of the subject or a Master’s degree in Statistics/ Mathematical Statistics/ Applied Statistics for Post 2.\r\n\r\nSelection Process: Candidates will be selected based on Written Examination, Interview/ Personality Test.\r\n\r\nApplication Fee: Candidates have to Pay Rs. 200/- either by depositing the money in any branch of SBI by Cash or by using net banking facility of SBI, State Bank of Bikaner & Jaipur/ State Bank of Hyderabad/ State Bank of Mysore/ State Bank of Patiala/ State Bank of Travancore or by using Visa/ Master Credit/ Debit Card. No Fee for Female/ SC/ ST/ PH candidates.\r\n\r\nHow to Apply: Eligible candidates may apply online through the UPSC website www.upsconline.nic.in from 08-02-2017 to 03-03-2017 till 18:00 hrs.\r\n\r\nInstructions to Apply Online:\r\n1. Before going to Apply Online candidates need to scan their photograph & signature in JPG Format.\r\n2. Photograph digital size must be less that 40 kb and greater than 3 kb and resolution 140 pixel height by 110 pixel width and Bit Depth of image file should be 24 bit.\r\n3. Digital size of Signature must be less that 40 kb and greater than 1 kb and resolution 110 pixel height by 140 pixel width and Bit Depth of image file should be 24 bit.\r\n4. Log on through the website www.upsconline.nic.in.\r\n5. Click on “Online Application for Various Examinations of UPSC”.\r\n6. Click on “Part – I/ Part – II Registration”.\r\n7. Read the instructions carefully.\r\n8. Fill all Mandatory Details.\r\n9. After successful registration, a unique registration ID will be allotted, note down the ID & password.\r\n10. Fill all the details regarding personal profile, contact details, age relaxation, qualification, experience, Professional Registration, Language, Miscellaneous Module\r\n11. Candidates have to choose the Recruitment Test Centre & should upload documents in Document Upload Module.\r\n12. After uploading photograph & signature preview the ORA form and check the details carefully.\r\n13. Click on the submit button.\r\n14. Candidates can Pay Online using the Internet banking facility in SBI or other associated banks or can pay through Visa/ Master Debit or Credit card issued by any Bank/ Institution.\r\n15. Here the Transaction ID & Date of Registration details will directly uploaded automatically.\r\n16. Now pay the fee through cash at any branch of State Bank of India through the Pay-in-Slip\r\n17. A transaction ID will be given, again revisit the website and click on the “Click here to view your Previous/ Currently active applications”.\r\n18. Log in by registration ID & password, candidates can see “My Active Application (My draft Application)” link.\r\n19. Now fill the details of transaction ID and Date of Transaction if paid through cash.\r\n20. Click “Continue”, check the details of fee and submit the application.\r\n21. Now take printout of online application for future use.\r\n\r\nImportant Dates:\r\n\r\nStarting Date to Apply Online	08-02-2017\r\nClosing Date to Apply Online	03-03-2017 till 18:00 hrs\r\nLast Date for Payment of Fee through Cash	02-03-2017 at 23.59 hrs\r\nLast Date for Payment of Fee through Debit/ Credit Card or Internet Banking Payment	03-03-2017 till 23:59 hrs\r\nDate of Competitive Examination	From 12-05-2017\r\nDate of Result of Examination	August, 2017\r\n\r\n\r\n', '2017-02-11', '2017-02-21', 0, 0, 0, 0);
