(176, 7, 0, 1, 'SPIC India Chandigarh-40 DEO Posts', 'SPIC India Chandigarh Vacancy Details:\r\nTotal No. of Posts: 40\r\nName of the Post: Data Entry Operator\r\n\r\nEducational Qualification: Candidates should posses Bachelor’s Degree and proficiency in operation of Computer(Word Processing and Spread Sheets) with Typing Knowledge.\r\n\r\nSelection Process: Candidates will be selected based on merit list of online test.\r\n\r\nApplication Fee: Candidates should pay Rs. 350/- through online by using debit/credit card or Internet Banking.\r\n\r\nHow to Apply: Eligible candidates may apply online through the website www.spicindia.com from 04-02-2017 to 23-02-2017.\r\n\r\nInstructions to Apply Online:\r\n1. Before applying online candidate should have scanned copy of recent photograph, signature & soft copy of resume.\r\n2. Log on to website www.spicindia.com.\r\n3. Click on Appointments.\r\n4. Select desired post & click on Apply.\r\n5. Fill all the details carefully & submit the form.\r\n6. Take Print out of online application form for future use.\r\n\r\nImportant Dates:\r\nStarting Date to Apply Online: 04-02-2017\r\nLast Date to Apply Online: 23-02-2017\r\n\r\n\r\n\r\n', '2017-02-11', '2017-02-21', 0, 0, 0, 0),
(177, 7, 0, 1, 'Rajasthan High Court-District Judge Posts', 'Rajasthan High Court Recruitment 2017 – Apply Online for District Judge Posts: Rajasthan High Court has published notification for the recruitment of District Judge vacancies. Eligible candidates may apply online from 14-02-2017 to 06-03-2017 up to 11:59 pm. Other details like age limit, educational qualification, selection process, application fee & how to apply are given below….\r\n\r\nRajasthan High Court Vacancy Details:\r\nTotal No. of Posts: 27\r\nName of the Post: District Judge\r\n\r\nAge Limit: Candidates age limit should be between 35 – 45 years as on 01-01-2018. Age relaxation is applicable to 05 years for SC/ ST/ OBC and Women candidates.\r\n\r\nEducational Qualification: Candidates should posses Bachelors Degree of Laws (Professional) of any University established by Law in India and recognized as such under the Advocates Act, 1961.\r\n\r\nSelection Process: Candidates will be selected based on examination & interview.\r\n\r\nApplication Fee: Candidates should pay Rs. 250/- for SC/ ST/ PWD, Rs. 500/- for OBC candidates & Rs. 800/- for all other candidates through Demand Draft of any bank in favour of Registrar General, Rajasthan High Court, Jodhpur payable at Jodhpur.\r\n\r\nHow to Apply: Eligible candidates may apply online through the website www.hcraj.nic.in from 14-02-2017 to 06-03-2017 up to 11:59 pm & send hard copy of the online application with copies of educational qualification certificates, experience certificate, caste certificate and demand draft to the Rajasthan High Court, Jodhpur on or before 24-03-2017 during office hours.\r\n\r\nInstructions to Apply Online:\r\n1. Candidates log on the website www.hcraj.nic.in\r\n2. Click on Recruitment ———–> Online Application Portal\r\n3. Select the desired post & Again click on Apply Online\r\n4. Read all instructions & fill all the details\r\n5. Check once before submit the form\r\n6. Now take a print out of online application for future use\r\n\r\nImportant Dates:\r\nStarting Date to Apply Online: 14-02-2017\r\nLast Date to Apply Online: 06-03-2017 up to 11:59 pm\r\nLast Date for Receipt of Hard Copy of the Online Application: 24-03-2017 during office hours.\r\n\r\n\r\n\r\n', '2017-02-17', '2017-02-27', 0, 0, 0, 0),
(178, 7, 0, 1, 'SBI Recruitment 2017-Officer Posts', 'Total No. of Posts: 255\r\nName of the Post: Officer\r\n1. Sales Head: 01 Post\r\n2. Products, Investments & Research Head: 01 Post\r\n3. Operations Head: 01 Post\r\n4. Manager (Business Development): 01 Post\r\n5. Manager (Business Process): 01 Post\r\n6. Central Research Team: 04 Posts\r\n7. Acquisition Relationship Manager: 21 Posts\r\n8. Relationship Manager: 120 Posts\r\n9. Relationship Manager (Team Lead): 15 Posts\r\n10. Investment Counsellor: 25 Posts\r\n11. Customer Relationship Executive: 65 Posts\r\n\r\nAge Limit: Candidates age limit should be between 40 – 52 years for Post No. 01, 02, 35 – 45 years for Post No. 03, 30 – 40 years for Post No. 04 to 06, 22 – 35 years for Post No. 07, 23 – 35 years for Post No. 08, 10, 25 – 40 years for Post No. 09 & 20 – 35 years for Post No. 10 as on 01-03-2017. Age relaxation is applicable to 05 years for SC/ ST, 03 years for OBC, 15 years for PWD (SC/ ST), 13 years for PWD (OBC) and 10 years for PWD (General) candidates.\r\n\r\nEducational Qualification: Candidates should possess MBA/ PGDM from reputed Colleges for Post No. 01, 03 to 06, Graduation/ Post Graduation from the reputed Colleges with Knowledge and Experience in Market Analytics and Passion for Research in Economics trend and Products for Post No. 02, Graduation from Government recognized University or Institution for Post No. 07 to 09 & 11 and Graduation/ Post Graduation with AMFI/ NISM (Module V) certified from Government recognized University or Institutions and Candidates with CFP/ CFA/ SEBI IA Certifications for Post No. 10 with relevant experience.\r\n\r\nSelection Process: Candidates will be selected based on personal interview.\r\n\r\nApplication Fee: Candidates should pay Rs. 600/- for General and OBC candidates & Rs. 100/- for SC/ ST/ PWD candidates through online payment gateway by using debit card/ credit card/ Internet\r\nBanking etc.\r\n\r\nHow to Apply: Eligible candidates may apply online through the website www.sbi.co.in from 24-03-2017 to 10-04-2017 & send hard copy of the online application with photocopies of ID Proof, date of birth certificate, educational qualification certificates, mark sheet/ degree certificate, experience certificate, brief resume, e receipt of fee payment, SC/ ST certificate, OBC certificate, PWD certificate by post to the State Bank of India, Central Recruitment & Promotion Department, Corporate Centre, 3rd Floor, Atlanta Building, Nariman Point, Mumbai – 400 021 on or before 13-04-2017.\r\nImportant Dates:\r\n\r\nStarting Date to Apply Online & Payment of Fee	24-03-2017\r\nLast Date to Apply Online & Payment of Fee	10-04-2017\r\nClosure for Editing Application Details	10-04-2017\r\nLast Date for Receipt of Hard Copy of the Online Application	13-04-2017 \r\nLast Date for Printing your Application	25-04-2017\r\n\r\n\r\n\r\n', '2017-03-25', '2017-04-04', 0, 0, 0, 0),
