n certificates, experience certificates, caste certificates, self addressed/ stamped envelope of size 24 x 11 cm and any other documents supporting their candidature in an envelope should be super scribed with “Application for the Post of ———————” through ordinary post to the Air Force Stations/ Units, Relevant Address (Refer the Notification) within 30 days from the date of advertisement.\r\n\r\nImportant Dates:\r\nDate of Advertisement: 25-02-2017 to 05-03-2017\r\nLast Date for Receipt of Application: within 30 days from the date of advertisement.\r\n\r\n\r\n\r\n\r\n\r\n\r\n', '2017-03-25', '2017-04-04', 0, 0, 0, 0),
(181, 7, 0, 1, 'Punjab & Haryana High Court-229 Stenographer Gr III Posts', 'Punjab & Haryana High Court Vacancy Details:\r\nTotal No.of Posts: 229\r\nName of the Posts: Stenographer Grade-III\r\n1. Gen: 51 Posts\r\n2. SC of Punjab: 81 Posts\r\n3. BC/ OBC of Punjab: 22 Posts\r\n4. PHC of Punjab: 20 Posts\r\n5. ESM: 55 Posts\r\n\r\nAge Limit: Candidates age should be between 18-37 years for General, 18-42 years for SC of Punjab, BC/ OBC of Punjab, 18-45 years for Candidates who are already in service in Government/ Semi/ PSU as on 01-01-2017 & for more information refer the notification.\r\n\r\nEducational Qualification: Candidates should possess degree of Bachelor of Arts or Bachelor of Science or equivalent thereto from a recognized university and must have proficiency in operation of computers.\r\n\r\nSelection Process: Candidates will be selected based on interview.\r\n\r\nApplication Fee: candidates should pay Rs. 1000/- for General, Reserved Category of other State, Rs. 250/- for SC/ BC/ OBC/ ESM of State of Punjab, Rs. 500/- for General of PHC of Punjab , Rs. 125/- for SC/ BC/ OBC/ ESM of PHC of Punjab candidates (non-refundable) by the way of “Cash Deposit Receipt” printed after completion of Step-I of registration in any Branch of State Bank of India only under Screen 8888 (Fee Type-21).\r\n\r\nHow to Apply: Eligible candidates may apply online through the website www.sssc.gov.in from 20-03-2017 to 18-04-2017 by 11.59 PM for step I registration & for step II registration on or before 21-04-2017 by 11:59 P.M.\r\n\r\nImportant Dates:\r\n\r\nStarting Date for Online Application	20-03-2017\r\nLast Date/ Time for Registration Step-I	18-04-2017 by 11.59 PM\r\nLast Date for Receipt of Application Fee	20-04-2017 (within Banking Hours)\r\nLast Date/ Time for Registration Step-II	21-04-2017 by 11:59 P.M\r\nLast Date for Editing of Application	21-04-2017 by 11.59 PM\r\nDate of Exam	May 2017\r\n\r\n\r\n', '2017-03-25', '2017-04-04', 0, 0, 0, 0),
