(192, 7, 0, 1, 'SSC Recruitment 2017 – Apply Online for JHT, SHT & Other Posts', 'SSC Vacancy Details:\r\nName of the Exam: Junior Hindi Translator, Junior Translator, Senior Hindi Translator and Hindi Pradhyapak Examination 2017\r\nName of the Post:\r\n1. Junior Translator in Central Secretariat Official Language Service (CSOLS)\r\n2. Junior Translator in M/o Railways (Railway Board)\r\n3. Junior Translator in Armed Forces Headquarters (AFHQ)\r\n4. Junior Translator/Junior Hindi Translator in subordinate offices who have adopted Model RRs of DoP&T for JT/JHT\r\n5. Senior Hindi Translator in various Central Government Ministries/ Departments/ Offices\r\n6. Junior Translator/ Junior Hindi Translator in subordinate offices who have not yet adopted Model RRs of DoP&T for JT/ JHT\r\n7. Hindi Pradhyapak in Central Hindi Training Institute (CHTI)\r\n\r\nAge Limit: Candidates age limit should be not exceeding 30 years as on 01-01-2017. Age relaxation is applicable to 05 years for SC/ ST, 03 years for OBC, 10 years for PH, 13 years for PH (OBC) & 15 years for PH (SC/ ST) Candidates. For more relaxation details refer the notification.\r\n\r\nEducational Qualification: Candidates should possess Master’s Degree of a recognized University in Hindi with English as a compulsory or elective subject or as the medium of examination at the degree level or Master’s Degree of a recognized University in English with Hindi as a compulsory or elective subject or as the medium of examination at the degree level or Master’s Degree of a recognized University in any subject other than Hindi or English, with Hindi medium and English as a compulsory or elective subject or as the medium of a examination at the degree level or Master’s Degree of a recognized University in any subject other than Hindi or English, with English medium and Hindi as a compulsory or elective subject or as the medium of examination at the degree level or Master’s Degree of a recognized University in any subject other than Hindi or English with Hindi and English as compulsory or elective subjects or either of the two as a medium of examination and the other as a compulsory or elective subject at degree level and Recognized Diploma or Certificate course in translation from Hindi to English & vice versa for Post No. 01 to 05, Master’s Degree of a recognized University in Hindi or English with English or Hindi as a compulsory or elective subject at degree level or Bachelor’s Degree with Hindi and English as main subjects (which includes the term compulsory and elective) for Post No. 06, Bachelor’s Degree in Hindi with English as one of the subject at degree level either as compulsory or optional from a recognized University or Institute plus Master’s degree in any subject from a recognized University or Institute plus Bachelor of Education from a recognized University/ Institute or Bachelor’s degree in any subject from a recognized University or Institute plus Master’s degree in Hindi with English as one of the subjects at degree level either as compulsory or optional from a recognized University or Institute plus Bachelor of Education from a recognized University/ Institute for Post No. 07 with relevant experience.\r\n\r\nSelection Process: Candidates will be selected based on computer based written & descriptive exam.\r\n\r\nApplication Fee: Candidates should pay Rs. 100/- through SBI Challan/ SBI Net banking or through credit/ debit cards of any bank. No fee for Women, SC, ST, PWD and Ex Servicemen candidates as per rules/ instructions of Department of Personnel and Training, Government of India.\r\n\r\nHow to Apply: Eligible candidates may apply online through the website www.ssconlie.nic.in from 15-04-2017 to 05-05-2017 up to 05:00 P.M.\r\n\r\nInstructions to Apply Online:\r\n1. Candidates log on the website www.ssconlie.nic.in\r\n2. Click on Apply & Select the deired post\r\n3. Again Click on Apply Link\r\n4. Fill the form in 2 Parts (Part-I Registration, Part-II Registration).\r\n5. In Part I Registration, Candidates have to fill basic information carefully.\r\n6. After filling the Part-I, If there is no need to make any corrections then Click on “I agree” button. Thereafter no correction/ modification etc will be allowed.\r\n7. Registration No will be generated, Note down the registration number or take out the print out of the page.\r\n8. In Part II registration candidates have to enter the payment details, upload the photograph & scanned signature.\r\n9. Those who are exempted from payment of fee can skip that entering those fields.\r\n10. Fill all the details carefully & Submit the form.\r\n11. Now take printout of online application for future use.\r\n\r\nImportant Dates:\r\n\r\nStarting Date to Apply Online	15-04-2017\r\nLast Date to Apply Online	05-05-2017 up to 05:00 P.M.\r\nLast Date for Payment of Fee through Challan	08-05-2017\r\nDate of Exam	15-06-2017\r\n\r\n\r\n', '2017-04-18', '2017-04-28', 0, 0, 0, 0),
