(200, 7, 0, 1, 'RBI Recruitment 2017 – Apply Online for 161 Officer-Grade ‘B’ Posts  ', 'Reserve Bank of India (RBI) has advertised a notification for the recruitment of Officers in Grade ‘B’ (General) – DR, DEPR and DSIM vacancies in Common Seniority Group (CSG) Streams – 2017. Eligible candidates can apply Online from 03-05-2017 to 23-05-2017. Other details like age limit, educational qualification & how to apply are given below…\r\n\r\nRBI Vacancy Details:\r\nTotal No of Posts: 161\r\nName of the Posts:\r\n1. Officers in Grade ‘B’ (DR) – (General): 145 Posts\r\n2. Officers in Grade ‘B’ (DR) – DEPR: 12 Posts\r\n3. Officers in Grade ‘B’ (DR) – DSIM: 04 Posts\r\n\r\nAge Limit: Candidates age should be in between to 30 years on the 01-05-2017 i.e., he/she must have been born not earlier than 02-05-1987 and not later than 01-05-1996. For candidates possessing M.Phil. and Ph.D. qualification, upper age limit will be 32 and 34 years respectively. Age relaxation is admissible as per rules.\r\n\r\nEducational Qualification: Candidates should have minimum of 60% marks (50% in case of SC/ ST/ PWD) or an equivalent grade in Bachelor’s Degree as well as in 12th (or Diploma or equivalent) and 10th Standard examinations for S.No-1, Master’s Degree in Economics/ Econometrics/ Quantitative Economics/ Mathematical Economics/ Integrated Economics Course/ Finance, with a minimum of 55% marks or an equivalent grade in aggregate of all semesters/ years from a recognized Indian or Foreign University/ Institute for S.No-2, Master’s Degree in Statistics/ Mathematical Statistics/ Mathematical Economics/ Econometrics/ Statistics & Informatics from IIT-Kharagpur/ Applied Statistics & Informatics from IIT-Bombay with a minimum of 55% marks or equivalent grade in aggregate of all semesters/ years for S.No-3 posts with adequate experience.\r\n\r\nSelection Process: Candidates will be selected based on applicants performance in online examination phase -I , II & Interview.\r\n\r\nApplication Fee: Applicants required to pay Rs.Rs.850/- (Application Fee with including intimation charges) for General/ OBC, Rs.100/- (Intimation charges only) for SC/ ST/ PWD candidates through online. Staff are exempted form this payment.\r\n\r\nHow to Apply: Eligible candidates can apply online through the website www.rbi.org.in from 03-05-2017 to 23-05-2017.\r\n\r\nImportant Dates:\r\n\r\nStarting Date for Apply Online & Fee Payment for S.No-1	03-05-2017\r\nStarting Date for Apply Online & Fee Payment for S.No-2 & 3	05-05-2017\r\nLast Date to Apply Online	23-05-2017\r\nDate of Phase-I Online Examination for S.No-1	17-06-2017\r\nDate of Phase-II Online Examination for S.No-1	07-07-2017\r\nDate of Paper –I Online Examination for S.No-2	17-06-2017\r\nDate of Paper – II & III Online/ Written Examination for S.No-2	06/ 07-07-2017\r\nDate of Paper –I Online Examination for S.No-3	17-06-2017\r\nDate of Paper – II & III Online/ Written Examination for S.No-3	06/ 07-07-2017\r\n\r\n', '2017-05-04', '2017-05-14', 0, 0, 0, 0),
(201, 7, 0, 1, 'SSC Recruitment 2017 – Apply Online for 2221 SI, CAPFs & ASI Posts', 'SSC Vacancy Details:\r\nTotal No. of Posts: 2221\r\nName of the Exam: Sub Inspector in Delhi Police, CAPFs and Assistant sub Inspector in CISF Examination 2017\r\nName of the Post:\r\n1. Sub-Inspector (Male) in Delhi Police: 616 Posts\r\n2. Sub-Inspector (Female) in Delhi Police: 256 Posts\r\n3. Sub-Inspector (GD) in CAPFs (Male): 697 Posts\r\n4. Sub-Inspector (GD) in CAPFs (Female): 89 Posts\r\n5. Assistant sub Inspector in CISF: 563 Posts\r\n\r\nAge Limit: Candidates age limit should be between 20-25 years as on 01-01-2017. Age relaxation is applicable to 05 years for SC/ ST candidates, 03 years for OBC candidates. For more relaxation details refer the notification.\r\n\r\nEducational Qualification: Candidates should possess Bachelors Degree from a recognised University or equivalent.\r\n\r\nSelection Process: Candidates will be selected based on computer based exam.\r\n\r\nApplication Fee: Candidates should pay RS. 100/- through SBI Challan/ SBI Net banking or through credit/ debit cards of any bank. No fee for SC, ST and Ex Serviceman Candidates.\r\n\r\nHow to Apply: Eligible candidates may apply online through the website www.ssconline.nic.in from 22-04-2017 to 15-05-2017 by 05:00 PM.\r\n\r\nInstructions to Apply Online:\r\n1. Candidates log on the website www.ssconlie.nic.in\r\n2. Click on Apply & Select the desired post\r\n3. Again Click on Apply Link\r\n4. Fill the form in 2 Parts (Part-I Registration, Part-II Registration).\r\n5. In Part I Registration, Candidates have to fill basic information carefully.\r\n6. After filling the Part-I, If there is no need to make any corrections then Click on “I agree” button. Thereafter no correction/ modification etc will be allowed.\r\n7. Registration No will be generated, Note down the registration number or take out the print out of the page.\r\n8. In Part II registration candidates have to enter the payment details, upload the photograph & scanned signature.\r\n9. Those who are exempted from payment of fee can skip that entering those fields.\r\n10. Fill all the details carefully & Submit the form.\r\n11. Now take printout of online application for future use.\r\n\r\nImportant Dates:\r\n\r\nStarting Date to Apply Online	22-04-2017\r\nLast Date to Apply Online	15-05-2017 by 05:00 PM.\r\nDate of Computer Based Exam (Paper I)	30-06-2017 to 07-07-2017\r\nDate of Computer Based Exam (Paper II)	08-10-2017\r\nDate for Generation of Challan	15-05-2017 before 05:00 PM\r\nLast Date for Payment of Fee through Challan of SBI	18-05-2017\r\n\r\n\r\n', '2017-05-04', '2017-05-14', 0, 0, 0, 0),
