(225, 7, 0, 1, 'OBC BANK', 'Oriental Bank of Commerce Vacancy Details:\r\nTotal No of Posts: 296\r\nName of the Post: Advocate\r\nName of the District:\r\n1. Ajmer: 08 Posts\r\n2. Alwar: 11 Posts\r\n3. Baran: 03 Posts\r\n4. Bhopal: 22 Posts\r\n5. Bikaner: 22 Posts\r\n6. Bundi: 03 Posts\r\n7. Churu: 03 Posts\r\n8. Dausa: 03 Posts\r\n9. Dewas: 03 Posts\r\n10. Gurgaon: 03 Posts\r\n11. Gwalior: 10 Posts\r\n12. Hanumangarh: 29 Posts\r\n13. Indore: 11 Posts\r\n14. Jaipur: 58 Posts\r\n15. Jodhpur: 10 Posts\r\n16. Kota: 09 Posts\r\n17. Morena: 06 Posts\r\n18. Nagaur: 03 Posts\r\n19. Pali: 04 Posts\r\n20. Raisen: 04 Posts\r\n21. Rajsamand: 04 Posts\r\n22. Rewari : 10 Posts\r\n23. Sehore: 05 Posts\r\n24. Sikar: 03 Posts\r\n25. Sriganganagar: 36 Posts\r\n26. Udaipur: 05 Posts\r\n27. Ujjain: 04 Posts\r\n28. Vidisha: 04 Posts\r\n\r\nEducational Qualification: Candidates should be advocate shall be empanelled for Civil Courts/ Title Search/ Securitization Act/ Consumer Forum/ Central Government Industrial Tribunal/ Complaint under Sec. 138 of Negotiable Instruments Act (if amount involved is less than 10 lac) etc., advocate shall consist of advocates from amongst the energetic and promising members of the bar preferably with excellent academic background, have a minimum 5 years of standing practice at the Bar or is ex banker having length of service or retired executive of reputed PSU having experience as enumerated here under and shall have attended different types of matters before the Courts / Forum/ Tribunals, have expertise in most of the following fields such as Documentation, title search, Banking laws, Recovery litigation before Courts and Securitization Act, District Consumer Forum, Criminal Complaints, Complaints u/s 138 N.I. Act, Labour Cases/ CGIT.\r\n\r\nSelection Process: Candidates will be selected based on applicants performance in Interview.\r\n\r\nHow to Apply: Eligible candidates can send their application in prescribed application format along with relevant documents to Oriental Bank of Commerce on or before 26-08-2017 till 05.00 PM\r\n\r\nLast Date for Receipt of Application: 26-08-2017 till 05.00 PM\r\n\r\n\r\n\r\n\r\nOriental Bank of Commerce Recruitment 2017 – 86 Advocate Posts: Oriental Bank of Commerce has given an employment notification for the recruitment of 86 Advocate vacancies on various Junior, Senior Panel (Districts). Eligible candidates may apply in the prescribed format on or before 31-08-2017 at 05.00 pm. Other details like educational qualification, how to apply are given below…\r\n\r\nOriental Bank of Commerce Vacancy Details:\r\nTotal No of Posts: 86\r\nName of the Post: Advocate\r\nName of the Districts:\r\n1. Agra: 06 Posts\r\n2. Aligarh: 03 Posts\r\n3. Barabanki: 03 Posts\r\n4. Bhdohi: 02 Posts\r\n5. Bharatpur: 02 Posts\r\n6. Chandauli: 02 Posts\r\n7. Deoria: 03 Posts\r\n8. Fatehpur: 02 Posts\r\n9. Firojabad: 03 Posts\r\n10. Gorakhpur: 07 Posts\r\n11. Hathras: 03 Posts\r\n12. Kanpur Nagar: 06 Posts\r\n13. Lucknow: 19 Posts\r\n14. Mathura: 06 Posts\r\n15. Raebareilly: 02 Posts\r\n16. Sant Kabir Nagar: 02 Posts\r\n17. Sant Ravidas Nagar: 02 Posts\r\n18. Sitapur: 03 Posts\r\n19. Unnao: 03 Posts\r\n20. Varanasi: 07 Posts\r\n\r\nEducational Qualification: Candidates should have advocate shall be empanelled for Civil Courts/ Title Search/ Securitization Act/ Consumer Forum/ Central Government Industrial Tribunal/ High Court/ State Commission/ DRT/ DRAT/ National Commission/ Supreme Court/ Criminal Complaint under Sec. 138 of Negotiable Instruments Act (if amount involved is less than 10 lac) etc. and minimum 5 years of standing practice at the Bar or is ex banker having length of service or retired executive of reputed PSU having experience as enumerated here under and shall have attended different types of matters before the Courts / Forum/ Tribunals, have expertise in most of the following fields such as Documentation, title search, Banking laws, Recovery litigation before Courts and Securitization Act, District Consumer Forum, Criminal Complaints, Complaints u/s 138 N.I. Act, Labour Cases/ CGIT.\r\n\r\nSelection Process: Candidates will be selected based on interview.\r\n\r\nHow to Apply: Eligible candidates can send their application in the prescribed format along with relevant documents to Oriental Bank of Commerce on or before 31-08-2017 at 05.00 pm.\r\n\r\nLast Date for Receipt of Application: 31-08-2017 at 05.00 pm.\r\n\r\n\r\n\r\n', '2017-08-10', '2017-08-20', 1, 0, 0, 0),
(226, 7, 0, 1, 'BANK OF MAHARASTRA', 'Bank of Maharashtra Recruitment 2017 – Apply Online for Security officer Posts: Human Resources Management Department, Bank of Maharashtra, pune has advertised a notification for the recruitment of Manager (MMGS-II) Security officer vacancies. Eligible candidates can apply online from 12-08-2017 to 02-09-2017. Other details like age limit, educational qualification, selection process & how to apply are given below…\r\n\r\nBank of Maharashtra Vacancy Details:\r\nTotal No. of Posts: 13 \r\nName of the Post: Manager (MMGS-II) Security officer\r\n\r\nAge Limit: Candidates age limit should be between 25 – 40 years as on 30-09-2017.\r\n\r\nEducational Qualification: Candidates should possess Graduation in any discipline from a University recognised by the Government of India or any equivalent qualification recognised as such by Central Government.\r\n\r\nSelection Process: Candidates will be selected based on examination/ Group discussions/ interview.\r\n\r\nApplication Fee: Candidates should pay Rs. 600/- (Application fee + intimation charges) for General/ OBC candidates & Rs. 100/- for Sc/ ST/ PWD Candidates through online.\r\n\r\nHow to Apply: Eligible candidates can apply online through the website www.bankofmaharashtra.in from 12-08-2017 to 02-09-2017 & send Print copy of on line application with attested copies of certificates in support of age, qualifications & experience etc., & in an envelope must be written as “Post applied for” to The Asstt. General Manager (IR &HRD) Bank of Maharashtra ‘Lokmangal” 1501, Shivaji Nagar Pune-411005 on or before 12-09-2017.\r\n\r\nImportant Dates:\r\nStarting Date to Apply Online & Fee Payment: 12-08-2017 \r\nLast Date to Apply Online & Fee Payment: 02-09-2017\r\nLast Date for receipt of hard copy of application: 12-09-2017\r\n\r\n\r\n\r\n', '2017-08-10', '2017-08-20', 1, 0, 0, 0),
(227, 7, 0, 1, 'IBPS CRP RRB VI 2017 ', 'IBPS Vacancy Details:\r\nTotal No.of Posts: 14192\r\nName of the Posts:\r\n1. Office Assistant (Multipurpose): 7374 Posts\r\n2. Officers Scale I: 4865 Posts\r\n3. Officers Scale II (Agriculture Officer): 169 Posts\r\n4. Officers Scale II (Marketing Officer): 33 Posts\r\n5. Officers Scale II (Treasury Manager): 11 Posts\r\n6. Officers Scale II (Law Officer): 21 Posts\r\n7. Officers Scale II (Chartered Accountant): 34 Posts\r\n8. Officers Scale II (Information Technology Officer): 83 Posts\r\n9. Officers Scale II (General Banking Officer): 1395 Posts\r\n10. Officers Scale III: 207 Posts\r\n\r\nAge Limit: Candidates age should be between 18-28 years (candidates should have not been born earlier than 02-07-1989 and later than 01-07-1999 (both dates inclusive) for Office Assistant (Multipurpose), 18-30 years (candidates should not have been born earlier than 03-07-1987 and later than 30-06-1999 (both dates inclusive) for Officer Scale- I, 21-32 years (candidates should not have been born earlier than 03-07-1985 and later than 30-06.-996 (both dates inclusive) for Officer Scale- II, 21-40 years (candidates should not have been born earlier than 03-07-1977 and later than 30-06-1996 (both dates inclusive) for Officer Scale- III as on 01-07-2017. Age relaxation is admissible to 5 years for SC/ ST, 3 years for OBC, 10 years for PWD & for other refer notification.\r\n\r\nEducational Qualification: Candidates should possess Degree in any discipline from a recognized University or its equivalent for S.No-1, 2, 9, 10 Posts, Degree in Agriculture/ Horticulture/ Dairy/ Animal Husbandry/ Forestry/ Veterinary Science/ Agricultural Engineering/ Pisciculture for S.No-3, MBA in Marketing from a recognized university for S.No-4, be Charted Accountant or MBA in Finance from a recognized university/ institution for S.No-5, Degree from a recognized University in Law or its equivalent for S.No-6, have Certified Associate (CA) from Institute of Chartered Accountants of India for S.No-7, Degree from a recognized University in Electronics/ Communication/ Computer Science/ Information Technology or its equivalent for S.No- 8 Posts. for more information refer notification.\r\n\r\nSelection Process: Candidates will be selected based on Online examination (Preliminary & Main) for Officers Scale I & Office Assistants (Multi-purpose), Common interview for Officers Scale I, single online examination & Common interview for Officers Scale II (Generalist and Specialists) & Scale III.\r\n\r\nApplication Fee: Applicants required to pay Rs.100/- for SC/ ST/ PWD candidates, Rs. 600/- for all others for Officer (Scale I, II & III), Rs.100/- for SC/ ST/ PWD/ EXSM candidates, Rs. 600/- for all others for Office Assistant (Multipurpose) through online by using Debit Cards (RuPay/ Visa/ Master Card/ Maestro), Credit Cards, Internet Banking, IMPS, Cash Cards/ Mobile Wallets. Bank Transaction charges for Online Payment of application fees/ intimation charges will have to be borne by the candidate.\r\n\r\nHow to Apply: Eligible candidates can apply online through the website www.ibps.in from 24-07-2017 to 14-08-2017.\r\n\r\nImportant Dates:\r\n\r\nStarting Date for Online Application\r\n& Payment of fee	24-07-2017 \r\nLast Date for Online Application\r\n& Payment of fee	14-08-2017\r\nLast Date for Printing of Application	29-08-2017\r\nDownload of call letters for\r\nPre- Exam Training for Officer Scale-I	August 2017\r\nConduct of Pre-Exam Training\r\nfor Officer Scale-I	28-08-2017 to \r\n03-09-2017\r\nDownload of call letters for Pre- Exam Training\r\nfor Office Assistant	August 2017\r\nConduct of Pre-Exam Training\r\nfor Office Assistant	04-09-2017 to \r\n09-09-2017\r\nDownload of call letters for online examination\r\n— Preliminary	Officer Scale-I- August 2017\r\nOffice Asst — September 2017\r\nOnline Examination — Preliminary	Officer Scale-I — 09-09-2017, \r\n10-09-2017 and 16-09-2017 \r\nOffice Asst- 17, 23 & 24-09-2017\r\nResult of Online exam — Preliminary	Officer Scale-I — October 2017 \r\nOffice Asst- October 2017\r\nDownload of Call letter for Online exam — Main / Single	Officer Scale- I, II & III -\r\nOctober 2017\r\nOffice Asst- November 2017\r\nOnline Examination — Main / Single	Officers (I, II & III) — \r\n05-11-2017 \r\nOffice Asst – 12-11-2017\r\nDeclaration of Result —\r\nMain/ Single (For Officers Scale I, II and III)	November 2017\r\nDownload of call letters for interview\r\n(For Officers Scale I, II and III)	December 2017\r\nConduct of interview\r\n(For Officers Scale I, II and III)	December 2017\r\nProvisional Allotment \r\n(For Officers Scale I, II and III \r\n& Office Assistant. (Multipurpose))	January 2018\r\n\r\n\r\n\r\n', '2017-08-10', '2017-08-20', 1, 0, 0, 0),
(228, 7, 0, 1, 'SBI Recruitment 2017 – Apply Online for Specialist Cadre Officer Posts  ', 'SBI Vacancy Details:\r\nTotal No. of Posts: 21\r\nName of the Post: Specialist Cadre Officer\r\n1. DGM (Cyber Security): 01 Post\r\n2. AGM (Cyber Security): 01 Post\r\n3. Dy. Manager (IS Audit): 05 Posts\r\n4. Vice President – Customer Analytics (Asset Products): 01 Post\r\n5. Senior Manager (Product Specialist): 02 Posts\r\n6. Vice president (Complaints Management): 01 Post\r\n7. Assistant Vice President (IS Audit): 05 Posts\r\n8. Senior Manager (IS Audit): 05 Posts\r\n\r\nAge Limit: Candidates age limit should be between 28 – 45 years for S.No-1, 26 – 40 years as on 31-03-2017 for S.No-2, 21 – 35 years for S.No-3 as on 01-07-2017 for S.No-3, 26- 45 years for S.No-4, 27 – 35 years as on 31-03-2017 S.No-5, 6 Posts. For more information refer the Notification.\r\n\r\nEducational Qualification: Candidates should possess Engineering Graduation (BE/ B.Tech) with specialisation in Information Security/ IT Risk Management/ Information Assurance/ Cyber security and Digital Threat Management with any of specificed certificate in the notification for S.No-1, 2, BE/ B.Tech in information technology/ Computer Science/ Computer Application/ Electronics/ Electronics & Instrumentations with minimum 60% of marks for S.No-3, Master’s Degree in Statistics, Mathematics from reputed university/ MBA (Marketing/ Finance/ Operations) or MCA from reputed institution for S.No-4, MBA from a reputed institute for S.No-5, Engineering Graduation with MBA in Marketing from a reputed University/ institute for S.No-6 Posts with adequate experience.For more information refer the Notification.\r\n\r\nSelection Process: Candidates will be selected based on applicants performance in interview.\r\n\r\nApplication Fee: Applicants required to pay Rs. 600/- for General and OBC candidates & Rs. 100/- for SC/ ST/ PWD candidates through online.\r\n\r\nHow to Apply: Eligible candidates can apply online through the website www.sbi.co.in from 25-07-2017 to 10-08-2017 (Extended to 22-08-2017 for S.No-1 & 2) & send hard copy of the online application with photocopies of ID Proof, date of birth certificate, educational qualification certificates, mark sheet/ degree certificate, experience certificate, brief resume, e receipt of fee payment, SC/ ST certificate, OBC certificate, PWD certificate & in an envelope should be superscribed as “Application for the post of____________” by post to The General Manager, State Bank of India, Corporate Centre, Central Recruitment & Promotion Department, Atlanta Building, 3rd floor, Plot No. 209, VBR, Block No.III, Nariman Point, Mumbai – 400 021 & soft copy of resume mail to crpd@sbi.co.in on or before 21-08-2017 (Extended to 31-08-2017 for S.No-1 & 2) .\r\n\r\nInstructions to Apply Online:\r\n1. Before applying to Online Applicants have valid email & Scanned copies of photo, signature.\r\n2. Candidates should log on to the website www.sbi.co.in.\r\n3. Go to Careers — > Click on “Latest Announcement”.\r\n4. Choose the desired post & Click on “Apply Online”.\r\n5. Click on “Click here for New Registration”, if you are new user.\r\n6. Complete the Registration & Click on “Submit”.\r\n7. After Registration, Log in with Registered Number & Password.\r\n8. Fill the all details in the application & upload Photo, Signature.\r\n9. Application fee should be paid through Online & then Submit the Form.\r\n8. Take printout of online application for future use.\r\n\r\nImportant Dates:\r\nStarting Date for Apply Online & Payment of Fee: 25-07-2017\r\nLast Date to Apply Online & Payment of Fee: 10-08-2017 (Extended to 22-08-2017 for S.No-1 & 2)\r\nLast Date for Receipt of Hard Copy of the Online Application: 21-08-2017 (Extended to 31-08-2017 for S.No-1 & 2)\r\n\r\n\r\n\r\n', '2017-08-10', '2017-08-20', 1, 0, 0, 0);
