(753, 'HOTEL RATNAWALI', '9929040000', 'jodhpur@hotelratnawali.com', 'ratnawali40', 'ffacf7fa1f63c829313b72845b4c7a3c', '149-150 NAI SARAK', '4427', 0, '0000-00-00 00:00:00', 65, 5, 0, 0, 1, 'HOTEL RATNAWALI ', '9929040000', 'ratnawali40ffac', 0, 6, '* HOTEL RATNAWALI\n\n* Hotel Ratnawali is a perfect place to stay in Jodhpur. it has a tradition of hospitality and personalized attention that makes it a distinguished address in Jodhpur. All the rooms in this luxurious budget hotel of Jodhpur are well furnished and equipped with all modern amenities. \nHotel Ratnawali Jodhpur boasts a Hospitality culture becoming the preferred choice of business & Leisure Travellers. \nHotel Ratnawali Strive to give you a comfortable stay in a luxurious budget hotel of Jodhpur is free from any worries. Our well-trained staffs are committed to provide you all the services that you always look for while away from home. \nHotel Ratnawali contemporary business hotel, which delivers refreshingly uncomplicated quality stay with a sparkle of simplicity. We are conveniently located in the city centre. Business and leisure travellers who demand international standards but seek authentic hospitality and local flair. \nHotel Ratnawali is located right in the heart of the city and is not far from the commercial hub. Their dedicated service ensures that all the guests are provided everything they need. Not only do the rooms come fitted with the best possible amenities, a good collection of personal care products are also provided. Moving out is not a problem either, the travel desk is ever ready to help you with it. Do not miss dining on the famous Awadhi cuisine, typical of the region, served at the round-the-clock coffee shop here.\n\nCONTACT US ON :-\n Address:- Hotel Ratnawali, 149-150, Nai Sadak, Jodhpur (Rajasthan)\n\nPhone:- +91 291 255-5698, 255-5699\n\nMobile:-+91 99290-40000\n\nEmail:- jodhpur@hotelratnawali.com\n\n', 0, 0, 0),
